import React, { Component } from "react";
import { Container, Row, Col } from 'react-bootstrap';


class HeaderCard extends Component {
    render() {
        return (
            <Container fluid>
                <Row className="my-3">
                    <div class="row my-3">
                        <img id="logoEsogu" class="col-md-auto" src="esogu-logo.png" />

                    </div>
                </Row>
            </Container>
        )
    }
}

export default HeaderCard;
